import React from 'react';
import { FiUser, FiPhone, FiVolume2, FiLock } from 'react-icons/fi';

const SettingsPage = () => {
  const settingsSections = [
    { icon: FiUser, title: 'Account', items: ['Profile', 'Notifications', 'Language'] },
    { icon: FiPhone, title: 'Calls', items: ['Call forwarding', 'Voicemail', 'Blocked numbers'] },
    { icon: FiVolume2, title: 'Audio', items: ['Ringtone', 'Volume', 'Sound effects'] },
    { icon: FiLock, title: 'Privacy', items: ['Call privacy', 'Data usage', 'Permissions'] },
  ];

  return (
    <div className="container mx-auto px-4 py-8">
      <div className="max-w-2xl mx-auto">
        <h2 className="text-2xl font-bold mb-6 text-gray-800 dark:text-white">Settings</h2>
        <div className="space-y-6">
          {settingsSections.map((section, index) => (
            <div key={index} className="bg-white dark:bg-gray-800 p-6 rounded-lg shadow-md">
              <div className="flex items-center mb-4">
                <section.icon className="text-2xl text-indigo-600 dark:text-indigo-400 mr-3" />
                <h3 className="text-xl font-semibold text-gray-800 dark:text-white">{section.title}</h3>
              </div>
              <ul className="space-y-2">
                {section.items.map((item, itemIndex) => (
                  <li key={itemIndex} className="flex items-center justify-between py-2 border-b border-gray-200 dark:border-gray-700 last:border-b-0">
                    <span className="text-gray-700 dark:text-gray-300">{item}</span>
                    <button className="text-indigo-600 dark:text-indigo-400 hover:underline focus:outline-none">
                      Edit
                    </button>
                  </li>
                ))}
              </ul>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default SettingsPage;
